import React from 'react';
import { Typography, Paper, LinearProgress } from '@mui/material';

const budget = 1000;
const spent = 350;

const BudgetTracking = () => {
  return (
    <Paper elevation={3} style={{ padding: '20px' }}>
      <Typography variant="h6" gutterBottom>
        Budget Tracking
      </Typography>
      <Typography variant="body1">Budget: ${budget}</Typography>
      <Typography variant="body1">Spent: ${spent}</Typography>
      <LinearProgress variant="determinate" value={(spent / budget) * 100} style={{ marginTop: '10px' }} />
    </Paper>
  );
};

export default BudgetTracking;
